// import '../App.css'
import swal from 'sweetalert2';
function Loginsignup() {
    let [state,setState] = useState('Login');
    let [name,setName] = useState("");
    let [email,setEmail] = useState("");
    let [password,setPassword] = useState("");
    let [arr,setarr] = useState([]);
    let [lemail,setLemail] = useState("");
    let [lpassword,setLpassword] = useState("");

        function signup(){
            let obj={
                name:name,
                email:email,
                password:password
            }
            setarr([...arr,obj]);
            /* eslint-disable */console.log(...oo_oo(`1473789683_20_12_20_28_4`,arr));
        }
        function Login(){
            let data = arr.filter((el.email== lemail && el.password==lpassword))
            if(data.length>0){
                Swal.fire({
                    title: "LOGIN SUCCSESSFULL!",
                    text: "You clicked the button!",
                    icon: "success"
                  });
                
            }
            else{
                Swal.fire({
                    icon: "error",
                    title: "Oops...",
                    text: "Something went wrong!",
                    footer: '<a href="#">Why do I have this issue?</a>'
                  });
              }
        }

  return (
    <div>
    {state === 'Login' ? 
    
        <body>
    
