  <div className="signin"> 

   <div className="content"> 

    <h2>Login</h2> 

    <div className="form"> 

     <div className="inputBox"> 

<input type="email" required onChange={(el)=>setLemail(el.target.value)}/> <i>Email</i> 

</div> 
