      <input type="password" required onChange={(el)=>setLpassword(el.target.value)}/> <i>Password</i> 

     </div> 

     <div className="links"> <a href="#">Forgot Password</a>
      <a href='#' onClick={()=>setState("SignUp")}>Sign UP</a>
