    <div className="signin"> 
  
     <div className="content"> 
  
      <h2>Sign Up</h2> 
  
      <div className="form"> 
  
       <div className="inputBox"> 
  
        <input type="text" required onChange={(el)=>setName(el.target.value)}/> <i>Username</i> 
  
       </div> 
       <div className="inputBox"> 
  
  <input type="email" required onChange={(el)=>setEmail(el.target.value)}/> <i>Email</i> 
  
  </div> 
       <div className="inputBox"> 
  
        <input type="password" required onChange={(el)=>setPassword(el.target.value)}/> <i>Password</i> 
  
       </div> 
  
       <div className="links"> <a href="#">Forgot Password</a> 
       <a href="#" onClick={()=>setState("Login")}>Login</a> 
  
       </div> 
  
       <div className
="inputBox"> 
  
        <input type="submit" value="Login" onClick={signup} /> 
  
       </div> 
  
      </div> 
  
     </div> 
  
    </div> 
  
   </section>
     </body>
    }
  </div>
    
  )
}

